import * as React from "react";
import { Admin, Resource } from 'react-admin';
import customDataProvider from './dataProvider';
import { EquipmentList } from './equipments/equipmentList'
import { EquipmentEdit } from './equipments/equipmentEdit';

import { RefurbisherList } from './refurbisher/refurbisherList';
import ViewModuleIcon from '@material-ui/icons/ViewModule';


const dataProvider = customDataProvider('https://api.airtable.com/v0/appp0agVAiPE5Etz7');


const App = () => (
  <Admin dataProvider={dataProvider} >
    <Resource name="machines" options={{ label: 'Nos machines' }} icon={ViewModuleIcon} list={EquipmentList} edit={EquipmentEdit} />
    <Resource name="reconditionneurs" list={RefurbisherList}  /> 
  </Admin>
);

export default App
